(def ev-theos 
  (map (fn [w b]
       (let [c (/ (count w) 2)
             vc 9
             ev-rbm (create-theoretical-rbm (mapv vec (partition vc (drop c w))) (vec (take vc b)) (vec (drop vc b)))]
       (reduce (fn [f s] (update-in f [(take vc s)] 
                             (fnil + 0)
                             (f/prob-visi ev-rbm s)))
        {}
     (f/state-space 9))))
     weights biases))
